('98b501b9-438d-4182-b6dc-957b241b9471', '株式市場の不正行為情報共有システムにおける基盤更改案件', 'b0eebc99-9c0b-4ef8-bb6d-6bb9bd380a12', 'f0eebc99-9c0b-4ef8-bb6d-6bb9bd380a16', 'onsite', 450000, 550000, '株式市場の不正行為情報共有システムにおける基盤更改案件。新旧仮想基盤の差分整理、システム構成確定、および既存ソースのマイグレーション（RHEL, Oracle DB, Apache, Tomcat, Java等のバージョンアップ）を担当。Linux構築経験（設計経験尚可）、仮想基盤上のOS・ミドルウェア設定経験が必須。自走してコミュニケーションが取れる方を求む。2026年1月～7月末、西葛西常駐、単価50万円前後。55歳まで、外国籍不可。', '期間: 2026年1月～7月末, 場所: 西葛西(常駐), 精算: 140-180, 募集人数: 1名, サイト: 45日, 就業時間: 9:30～18:00, 面談: 2回(web・対面未定), 商流制限: 貴社所属まで, 年齢制限: 55歳まで, 個人事業主制限: なし, 外国籍制限: 不可, 備考: 自発的なコミュニケーション・自走できる方(指示待ち不可), 要件抽出・解決能力, 健康面不安なし, 若手枠, 詳細設計経験尚可', 'published', true, now()),
('3bb69b93-ba91-4dfa-a70a-1a5b3f1f0231', 'ヘルスベイシスからの官公庁向けシステム基盤モダナイゼーション支援案件（サーバー運用設計・構築、...', 'd0eebc99-9c0b-4ef8-bb6d-6bb9bd380a14', 'f0eebc99-9c0b-4ef8-bb6d-6bb9bd380a16', 'onsite', 600000, 700000, 'ヘルスベイシスからの官公庁向けシステム基盤モダナイゼーション支援案件（サーバー運用設計・構築、仮想化基盤）。運用設計1名、基盤構築2名募集。必須スキルにLinux, Windows Server, VMware製品など。長期参画、外国籍不可、～50歳目安。単価は～65万円目安。', '官公庁向けシステム基盤モダナイゼーション支援（運用設計／仮想化基盤）プロジェクト。運用設計および仮想化基盤領域の設計・構築支援。作業期間は2026年1月～長期、作業場所は東中野（常駐）。募集人数は運用設計1名、基盤構築2名。面談1回（対面、面談設定済み）。精算は140h～190h、勤務時間9:00～17:50。外国籍不可。長期参画歓迎。交代要員枠。年齢は～50歳目安。', 'published', true, now()),
