('3c1cc8ec-eed5-44c6-ad97-8e780b8400a8', 'PHPを用いたファンサービスEC／ガチャシステムの開発・保守案件', 'b0eebc99-9c0b-4ef8-bb6d-6bb9bd380a12', 'f0eebc99-9c0b-4ef8-bb6d-6bb9bd380a16', 'hybrid', 570000, 670000, 'PHPを用いたファンサービスEC／ガチャシステムの開発・保守案件。既存システムのPHPバージョンアップ（5系→8系）対応を中心に、エンハンス開発・保守を担当。渋谷勤務（週3リモート可）、即日～長期。単価62万円前後。商流は貴社社員まで、日本国籍、40代前半までを想定。', 'ファンサービスEC／ガチャシステム開発, 急募, 即日～長期, 渋谷勤務 (週2出社+週3リモート), 基本設計～リリース工程, 体制11名参画中, 面談1回(対面), 商流制限:貴社社員まで, 国籍:日本国籍のみ, 年齢:40代前半まで, 契約形態:準委任契約(フリーランス可), 支払いサイト:40日。', 'published', true, now()),
